INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('5', '9', 'Featured Plus', 'featured-plus-adw', 'AlexDW', '1.02', 'https://www.opencart.com/index.php?route=marketplace/extension&filter_member=AlexDW', '<?xml version="1.0" encoding="UTF-8"?>\r\n<modification>\r\n\t<name>Featured Plus</name>\r\n\t<version>1.02</version>\r\n\t<author>AlexDW</author>\r\n\t<link>https://www.opencart.com/index.php?route=marketplace/extension&amp;filter_member=AlexDW</link>\r\n\t<code>featured-plus-adw</code>\r\n\t<file path="admin/controller/extension/module/featured.php">\r\n\t\t<operation>\r\n\t\t<search><![CDATA[\r\nif (isset($this->request->post[\'status\']))\r\n\t\t\t]]></search>\r\n\t\t\t<add position="before" ><![CDATA[\r\n// Featured+\r\n\t\t$data[\'text_titles\'] = $this->language->get(\'text_titles\');\r\n\t\t$data[\'text_shuffle\'] = $this->language->get(\'text_shuffle\');\r\n\r\n\t\tif (isset($this->request->post[\'titles\'])) {\r\n\t\t\t$data[\'titles\'] = $this->request->post[\'titles\'];\r\n\t\t} elseif (!empty($module_info) && isset($module_info[\'titles\'])) {\r\n\t\t\t$data[\'titles\'] = $module_info[\'titles\'];\r\n\t\t} else {\r\n\t\t\t$data[\'titles\'] = array();\r\n\t\t}\r\n\r\n\t\tif (isset($this->request->post[\'shuffle\'])) {\r\n\t\t\t$data[\'shuffle\'] = $this->request->post[\'shuffle\'];\r\n\t\t} elseif (!empty($module_info) && isset($module_info[\'shuffle\'])) {\r\n\t\t\t$data[\'shuffle\'] = 1;\r\n\t\t} else {\r\n\t\t\t$data[\'shuffle\'] = 0;\r\n\t\t}\r\n\r\n\t\t$this->load->model(\'localisation/language\');\r\n\t\t$data[\'languages\'] = $this->model_localisation_language->getLanguages();\r\n// Featured+\r\n\t\t\t]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n\r\n\t<file path="admin/view/template/extension/module/featured.twig">\r\n\t\t<operation>\r\n\t\t<search index="1"><![CDATA[\r\n<div class="form-group">\r\n\t\t\t]]></search>\r\n\t\t\t<add position="before"><![CDATA[\r\n<!-- Featured+ -->\r\n          <div class="form-group">\r\n            <label class="col-sm-2 control-label" for="input-titles">{{ text_titles }}</label>\r\n            <div class="col-sm-10">\r\n              {% for language in languages %}\r\n              <div class="input-group"><span class="input-group-addon">\r\n\t\t\t  <img src="language/{{ language.code }}/{{ language.code }}.png" title="{{ language.name }}" />\r\n\t\t\t  </span>\r\n                <input type="text" name="titles[title{{ language.language_id }}]" value="{{ titles[\'title\'~language.language_id] ? titles[\'title\'~language.language_id] : \'\' }}" placeholder="{{ text_titles }}" class="form-control" />\r\n              </div>\r\n              {% endfor %}\r\n            </div>\r\n          </div>\r\n          <div class="form-group">\r\n            <label class="col-sm-2 control-label" for="input-shuffle">{{ text_shuffle }} </label>\r\n            <div class="col-sm-10">\r\n              <div class="checkbox">\r\n                <label>\r\n                {% if shuffle %}\r\n                <input type="checkbox" name="shuffle" value="1" checked="checked" id="input-shuffle" />\r\n                {% else %}\r\n                <input type="checkbox" name="shuffle" value="1" id="input-shuffle" />\r\n\t\t\t\t{% endif %}\r\n                </label>\r\n              </div>\r\n            </div>\r\n          </div>\r\n<!-- Featured+ -->\r\n\t\t\t]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n\t<file path="catalog/controller/extension/module/featured.php">\r\n\t\t<operation>\r\n\t\t<search><![CDATA[\r\n$products =\r\n\t\t\t]]></search>\r\n\t\t\t<add position="before" ><![CDATA[\r\n// Featured+\r\n\t\t$lang = $this->config->get(\'config_language_id\');\r\n\t\t$title = isset($setting[\'titles\'][\'title\'.$lang]) && $setting[\'titles\'][\'title\'.$lang] ? $setting[\'titles\'][\'title\'.$lang] : \'\';\r\n\r\n\t\tif (isset($title) && $title) {\r\n\t\t\t$data[\'heading_title\'] = $title;\r\n\t\t}\r\n\r\n\t\tif (isset($setting[\'shuffle\']) && $setting[\'shuffle\']) {\r\n\t\t\tshuffle($setting[\'product\']);\r\n\t\t}\r\n// Featured+\r\n\t\t\t]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n\r\n\t<file path="admin/language/en-gb/extension/module/featured.php">\t\t\r\n\t\t<operation error="skip">\r\n\t\t\t<search><![CDATA[\r\n<?php\r\n\t\t\t]]></search>\r\n\t\t\t<add position="after"><![CDATA[\r\n// Featured+\r\n$_[\'text_titles\']\t= \'Header\';\r\n$_[\'text_shuffle\']\t= \'Shuffle\';\r\n// Featured+\r\n\t\t\t]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n\t<file path="admin/language/ru-ru/extension/module/featured.php">\t\t\r\n\t\t<operation error="skip">\r\n\t\t\t<search><![CDATA[\r\n<?php\r\n\t\t\t]]></search>\r\n\t\t\t<add position="after"><![CDATA[\r\n// Featured+\r\n$_[\'text_titles\']\t= \'Заголовок\';\r\n$_[\'text_shuffle\']\t= \'Случайный порядок\';\r\n// Featured+\r\n\t\t\t]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n</modification>', '1', '2020-11-26 22:40:16');
